import './App.css';
import { getDatabase, ref, set } from 'firebase/database';
import { app } from './firebase';

const db= getDatabase(app);

function App() {

  const putData =()=>{
    set(ref(db,"users/piyush"),{
      id:1,
      name:"Piyush",
      age:"21"
    });
  }

  return (
    <div className="App">
      <button onClick={putData}>Put Data</button>
    </div>
  );
}

export default App;
